import React, { Component }  from 'react';
import { PageHeader, Card, Image, Descriptions, Button } from 'antd';
import './index.less'; 
import { version } from 'less';

const gridStyle = {
  width: '100%',
  textAlign: 'center',
};

class ProfilePage extends Component {
  constructor(props) {
    super(props);
    this.state = {
    }
  }

  render() {

    return (
      <div className="profile-page">
        <PageHeader
          className="profile-page-header"
          onBack={() => null}
          title="我的"
          subTitle="Flight Aware Monitoring Platform"
        />
        <div className="profile-page-profile">
          <Card
              hoverable
              style={{ width: '100%', marginTop: 20 }}
            >
              <Image
                width={50}
                height={50}
                style={{margin: 10}}
                src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
                fallback="data:image/png;base64,"
              />
              <Card.Meta style={{ marginTop: 20 }} title="我是个小前端" description="项目数: 6" />
            </Card>
            <Card style={{marginTop: 10}}>
              <Card.Grid style={gridStyle}>
                <Descriptions
                  title="个人页面"
                  extra={<Button type="primary">详情</Button>}
                >
                  <Descriptions.Item style={{textAlign: 'left'}} label="项目id">623389</Descriptions.Item>
                  <Descriptions.Item label="项目描述">这是一个react构建的前端项目，个人主页</Descriptions.Item>
                  <Descriptions.Item label="创建时间">2020年11月23日</Descriptions.Item>
                </Descriptions>
              </Card.Grid>
              <Card.Grid style={gridStyle}>Content</Card.Grid>
              <Card.Grid style={gridStyle}>Content</Card.Grid>
              <Card.Grid style={gridStyle}>Content</Card.Grid>
              <Card.Grid style={gridStyle}>Content</Card.Grid>
              <Card.Grid style={gridStyle}>Content</Card.Grid>
            </Card>
        </div>
      </div>
    );
  }
}

export default ProfilePage;
